script: |
  super -f text -I q3239.spq | sort > q3239.out

inputs:
  - name: q3239.spq
    data: |
      SELECT ALL - 91 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q3239.out
    data: |
      -91
      -91
      -91
      -91
      -91
      -91
      -91
      -91
      -91
